import React from 'react';
import { Row, Col } from 'react-bootstrap';

const ActionDetail = ({ action }) => {
  return ( 
    <Row>
        <Col>
            <h2>{action.title}</h2>
            <h3>{action.timeframe}</h3>
            <ul className="list-unstyled">
                {action.types.map((type) => {
                    return (
                        <li>
                            <h4>{type.title}</h4>
                            <p>{type.description}</p>
                        </li>
                    );
                })}
            </ul>
        </Col>
    </Row>
  );
}

export default ActionDetail;
